(window.webpackJsonp=window.webpackJsonp||[]).push([[1],{"0XsT":function(n,e){n.exports='## Flex 弹性布局\nFlex组件是基于CSS FlexBox的一套封装方案。\n\n### 栅格\nFlex组件将外层容器的宽度(横向)或高度(纵向)平均分割为12个单元格。\n```html\n<wayo-flex-box>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n</wayo-flex-box>\n<wayo-flex-box>\n  <wayo-flex-cell :span="6"></wayo-flex-cell>\n  <wayo-flex-cell :span="6"></wayo-flex-cell>\n</wayo-flex-box>\n<wayo-flex-box>\n  <wayo-flex-cell :span="8"></wayo-flex-cell>\n  <wayo-flex-cell :span="3"></wayo-flex-cell>\n  <wayo-flex-cell :span="1"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### 对齐方式\n#### 首对齐(默认)\n对应`justify-content: flex-start;`\n\n```html\n<wayo-flex-box class="box" justify="start">\n  <wayo-flex-cell :span="6" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n#### 尾对齐\n对应`justify-content: flex-end;`\n\n```html\n<wayo-flex-box class="box" justify="end">\n  <wayo-flex-cell :span="6" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n#### 居中对齐\n对应`justify-content: center;`\n\n```html\n<wayo-flex-box class="box" justify="center">\n  <wayo-flex-cell :span="6" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n#### 首尾对齐\n**第一个子元素首对齐，最后一个子元素尾对齐，剩余空间均匀分配。**\n\n对应`justify-content: space-between;`\n\n```html\n<wayo-flex-box class="box" justify="space-between">\n  <wayo-flex-cell :span="6" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n#### 居中对齐，每个间隔均相等\n**元素之间的间隔 = 第一元素与起点的间隔 = 最后一个元素与终点的间隔。**\n\n对应`justify-content: space-evenly;`\n\n```html\n<wayo-flex-box class="box" justify="space-evenly">\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n#### 居中对齐，子元素间隔相等，首尾间隔相等\n**元素之间的间隔/2 = 第一元素与起点的间隔 = 最后一个元素与终点的间隔。**\n\n对应`justify-content: space-around;`\n\n```html\n<wayo-flex-box class="box" justify="space-around">\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### 列间距\nFlex-box的`gutter`属性可以指定子元素之间的精准间距，单位为`px`。\n\n```html\n<wayo-flex-box :gutter="20">\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### 列偏移\n设置Flex-cell的`offset`属性可以指定子元素据前一个元素的**偏移单元格个数**。\n\n```html\n<wayo-flex-box class="box">\n  <wayo-flex-cell :span="6" :offset="4" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n<wayo-flex-box class="box">\n  <wayo-flex-cell :span="6" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="3" :offset="2" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n<wayo-flex-box class="box">\n  <wayo-flex-cell :span="4" :offset="1" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="4" :offset="2" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### 纵向排列\n设置Flex-box的`direction`的值为`column`即可纵向排列子元素。需要注意的是，由于CSS规范中容器的`height`是由子元素决定，并不能跟`width`一样自动占满父容器。所以启用纵向排列的同时，**需要设置具体的`height`值**，单位为`px`。\n\n```html\n<wayo-flex-box class="box" direction="column" :height="100">\n  <wayo-flex-cell :span="8" class="cell"></wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell"></wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### 反向排列\n横向和纵向均适用。\n```html\n<wayo-flex-box class="box" direction="row-reverse">\n  <wayo-flex-cell :span="6" class="cell">1</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">2</wayo-flex-cell>\n  <wayo-flex-cell :span="2" class="cell">3</wayo-flex-cell>\n</wayo-flex-box>\n<wayo-flex-box class="box" direction="column-reverse" :height="200">\n  <wayo-flex-cell :span="6" class="cell">1</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">2</wayo-flex-cell>\n  <wayo-flex-cell :span="2" class="cell">3</wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### 九宫格\n开启Flex-box的`wrap`属性可以另超出容器宽度的子元素进行换行，合理设置可以实现九宫格的布局效果。\n\n#### 横向\n```html\n<wayo-flex-box class="box" direction="row" :wrap="true">\n  <wayo-flex-cell :span="4" class="cell">1</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">2</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">3</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">4</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">5</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">6</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">7</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">8</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">9</wayo-flex-cell>\n</wayo-flex-box>\n```\n\n#### 纵向\n```html\n<wayo-flex-box class="box" direction="column" :wrap="true" :height="300">\n  <wayo-flex-cell :span="4" class="cell">1</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">2</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">3</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">4</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">5</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">6</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">7</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">8</wayo-flex-cell>\n  <wayo-flex-cell :span="4" class="cell">9</wayo-flex-cell>\n</wayo-flex-box>\n```\n\n### Flex-box 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|direction|方向|string|row/column/row-reverse/column-reverse|row|\n|height|高度，仅纵向排列有效|number|-|-|\n|justify|主轴对齐模式|string|unset/start/end/center/space-between/space-evenly/space-around|start|\n|align|交叉轴对齐模式|string|unset/start/end/center/space-between/space-evenly/space-around|unset|\n|wrap|是否自动换行|boolean|-|false|\n|gutter|子元素间距|number|-|0|\n\n</div>\n\n### Flex-cell 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|span|占据的单元格个数|number|-|-|\n|offset|与前一个元素的间隔单元格个数|number|-|0|\n\n</div>'},"1peb":function(n,e){n.exports='## Stripe 条纹按钮\n条纹按钮是一个包含多条信息的按钮。\n\n### 基础使用\n```html\n<wayo-stripe>\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n</wayo-stripe>\n```\n\n### 尺寸\n内置尺寸可选`small/default/large`。\n```html\n\x3c!-- small --\x3e\n<wayo-stripe size="small">\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n</wayo-stripe>\n\x3c!-- default --\x3e\n<wayo-stripe size="default">\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n</wayo-stripe>\n\x3c!-- large --\x3e\n<wayo-stripe size="large">\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n</wayo-stripe>\n```\n\n### 禁用状态\n```html\n<wayo-stripe disabled>\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n</wayo-stripe>\n```\n\n### 自定义尺寸颜色\n如果内置的尺寸和颜色不满足开发需求，可以定制其宽度、高度、字号和颜色。\n```html\n<wayo-stripe :width="80" :height="70" :font-size="18" color="#000000">\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n</wayo-stripe>\n```\n\n> stripe按钮仅包含一种颜色，`color`属性将影响`fill`按钮的字体颜色以及`stroke`按钮的背景颜色。\n\n### 自由组合\n虽然我们并不推荐在stripe按钮中使用多于2个button，但是我们并未作此限制，所以你可以自由发挥想象力进行组合。\n```html\n<wayo-stripe>\n  <wayo-stripe-button icon="cny">25</wayo-stripe-button>\n  <wayo-stripe-button type="fill">预定</wayo-stripe-button>\n  <wayo-stripe-button>买定离手</wayo-stripe-button>\n</wayo-stripe>\n```\n\n### Stripe 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|size|尺寸|string|small/default/large|default|\n|color|颜色|string|-|-|\n|font-size|字体大小|number|-|-|\n|width|宽度|number|-|-|\n|height|高度|number|-|-|\n|disabled|禁用状态|boolean|-|false|\n\n</div>\n\n### Stripe-button 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|type|类型|string|fill/stroke|stroke|\n|icon|图标|string|Wayo内置图标|-|\n\n</div>'},"1q2V":function(n,e){n.exports='## ImageViewer 图片预览\nImageViewer是Slides组件的一种应用场景。\n\n### 基础用法\n```html\n<template>\n<section class="demo-box">\n  <wayo-image-viewer\n    :value="imageList"\n    :mask-color="maskColor"\n    :mask-opacity="maskOpacity"\n    @close="show=false"\n    @change="onChange"></wayo-image-viewer>\n</section>\n</template>\n\n<script>\nexport default {\n  data() {\n    return {\n      maskColor: \'#000000\',\n      maskOpacity: 0.6,\n      watchChange: false,\n      imageList: [\n        \'https://dimg02.c-ctrip.com/images/fd/tg/g1/M08/2A/B7/CghzflVQaLiAb42iAAEtDg7AQxQ346_C_604_394_Q90.jpg\',\n        \'https://dimg02.c-ctrip.com/images/fd/tg/g1/M05/2A/B7/CghzflVQaLmAWMv0AAEyAoZKHLY067_C_604_394_Q90.jpg\',\n        \'https://dimg01.c-ctrip.com/images/fd/tg/g1/M04/C8/42/CghzflWwuoKAIaTcACkS3IfJui4633_C_604_394_Q90.jpg\'\n      ]\n    }\n  },\n  methods: {\n    onChange(index){\n      alert(`当前展示索引值:${index}`);\n    }\n  }\n};\n<\/script>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|value|图片列表|Array|是|-|-|\n|indicator|是否显示指示器|boolean|否|-|true|\n|mask-color|背景色|string|否|-|#000000|\n|mask-opacity|背景透明度|number|否|-|0.6|\n\n</div>'},"1qy0":function(n,e,o){var a={"./components/block.md":"Bf2l","./components/button.md":"TAvu","./components/flex.md":"0XsT","./components/icon.md":"frNE","./components/image.md":"RXCI","./components/imageviewer.md":"1q2V","./components/lath.md":"zNef","./components/rate.md":"QkaN","./components/separator.md":"WxFc","./components/showcase.md":"e0Wz","./components/slides.md":"BUuD","./components/stripe.md":"1peb","./components/tabs.md":"ulLb","./components/tag.md":"ZX3u","./components/toast.md":"XIJ9","./guide/colors.md":"a1Ez","./guide/fonts.md":"dZkr","./guide/install.md":"vuDV","./guide/tutorial.md":"MIdU","./intro.md":"GRrk"};function t(n){var e=l(n);return o(e)}function l(n){var e=a[n];if(!(e+1)){var o=new Error("Cannot find module '"+n+"'");throw o.code="MODULE_NOT_FOUND",o}return e}t.keys=function(){return Object.keys(a)},t.resolve=l,n.exports=t,t.id="1qy0"},BUuD:function(n,e){n.exports='## Slides 幻灯片\n\n### 基础用法\n```html\n<wayo-slides>\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n```\n\n### 指示器类型\n```html\n\x3c!-- 圆形（默认） --\x3e\n<wayo-slides indicator-type="circle">\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n\x3c!-- 长条 --\x3e\n<wayo-slides indicator-type="square">\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n\x3c!-- 隐藏 --\x3e\n<wayo-slides indicator-type="square">\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n```\n\n### 循环切换\n将Slides组件的`loop`属性设置为`true`则开启循环切换，实现类型走马灯的效果。\n\n```html\n<wayo-slides loop>\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n```\n\n### 自动播放\n将Slides组件的`autoplay`属性设置为`true`则开启自动播放，同时循环切换自动开启。\n\n```html\n<wayo-slides autoplay>\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n```\n\n### 过渡动画类型\n修改Slides组件的`animation`属性可选动画类型为`slide`-滑动(默认)、`fade`-渐隐以及`none`-无动画。\n\n```html\n<wayo-slides animation="fade">\n  <wayo-slide>1</wayo-slide>\n  <wayo-slide>2</wayo-slide>\n  <wayo-slide>3</wayo-slide>\n</wayo-slides>\n```\n\n### Slides 属性\n<div class="table-box">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|initial-index|初始化展示的slide索引值|number|否|-|0|\n|indicator-type|指示器类型|string|否|square/circle/none|circle|\n|animation|动画类型|string|否|slide/fade/none|slide|\n|loop|开启循环切换|boolean|否|-|false|\n|autoplay|开启自动播放|boolean|否|-|false|\n|interval|自动切换的时间间隔，单位`ms`。仅在自动播放模式下有效|否|number|-|3000|\n\n</div>'},Bf2l:function(n,e){n.exports='## Block 区域\n\nWayo对Block组件的定义是：\n> 满宽的、独立的且具有一定语义的一个块级区域。\n\n可以参考编程语言的`namespace`概念辅助理解。\n\n一个Block组件可以包含多个同语义下的子组件。比如页面的顶栏可以定义为一个Block，顶栏区域内可以包含标题、子标题、评分等信息。\n\n### 基础用法\n```html\n<wayo-block>\n  <wayo-block-header>标题栏</wayo-block-header>\n  <wayo-block-content>\n    <wayo-block-title>内容标题</wayo-block-title>\n    <p>内容内容内容内容内容内容内容内容内容内容内容</p>\n  </wayo-block-content>\n</wayo-block>\n```\n\n### 自定义内容\n```html\n<wayo-block>\n  <wayo-lath border-bottom>\n    <wayo-lath-header title="评价"></wayo-lath-header>\n    <wayo-lath-tail icon="arrow-right" label="1139条"></wayo-lath-tail>\n  </wayo-lath>\n  <wayo-lath>\n    <div class="custom-content">\n      <div class="custom-content__header">\n        <span class="custom-content__uname">吃货甲</span>\n        <div class="custom-content__rate">\n          <span class="custom-content__date">4月2号</span>\n          <wayo-rate :score="4.5" :size="12"/>\n        </div>\n      </div>\n      <p class="custom-content__content">\n        今天邀请石家庄来的宾客，就是工作餐了，现在不能大吃大喝自己请客也不能太破费，不降请客今天邀请石家庄来的宾客，就是工作餐了今天邀请石家庄来...\n      </p>\n      <wayo-flex-box class="custom-content__gallery" :gutter="10">\n        <wayo-flex-cell class="custom-content__showcase" :span="3">\n          <wayo-image src="http://qcloud.dpfile.com/pc/s-MrVj_kK8JU0i3OfBTLlASXleG8GXUEkZLsklVH3uHtzJ2ui-GuL3NsET4yg0AAGybIjx5eX6WNgCPvcASYAw.jpg" :width="80"/>\n        </wayo-flex-cell>\n        <wayo-flex-cell class="custom-content__showcase" :span="3">\n          <wayo-image src="http://qcloud.dpfile.com/pc/s-MrVj_kK8JU0i3OfBTLlASXleG8GXUEkZLsklVH3uHtzJ2ui-GuL3NsET4yg0AAGybIjx5eX6WNgCPvcASYAw.jpg" :width="80"/>\n        </wayo-flex-cell>\n        <wayo-flex-cell class="custom-content__showcase" :span="3">\n          <wayo-image src="http://qcloud.dpfile.com/pc/s-MrVj_kK8JU0i3OfBTLlASXleG8GXUEkZLsklVH3uHtzJ2ui-GuL3NsET4yg0AAGybIjx5eX6WNgCPvcASYAw.jpg" :width="80"/>\n        </wayo-flex-cell>\n      </wayo-flex-box>\n    </div>\n  </wayo-lath>\n</wayo-block>\n```\n'},GRrk:function(n,e){n.exports="# Wayo\n轻量的移动端Vue组件库"},MIdU:function(n,e){n.exports="## 快速上手\n\n### Node模块（推荐）\n使用npm安装之后可以将Wayo作为Node的模块引入。\n\n#### 引入Wayo\n```javascript\nimport Vue from 'vue';\nimport Wayo from 'wayo';\n\nVue.use(Wayo);\n```\n\n#### 引入style文件\n可以在js文件中引入：\n```javascript\nimport './node_modules/wayo/dist/wayo.min.css';\n```\n\n推荐在项目style文件中引入，比如在项目`style.scss`中添加如下代码：\n```scss\n@import '~wayo/dist/wayo.min.css';\n```\n\n### CDN\n```html\n<html>\n  <head>\n    \x3c!-- 引入样式 --\x3e\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/wayo/dist/wayo.min.css\">\n  </head>\n  <body>\n    <div id=\"app\"></div>\n    \x3c!-- 引入组件库之前必须先引入vue --\x3e\n    <script src=\"https://unpkg.com/vue/dist/vue.js\"><\/script>\n    \x3c!-- 引入组件库 --\x3e\n    <script src=\"https://unpkg.com/wayo/dist/wayo.min.js\"><\/script>\n    <script>\n      new Vue({\n        el: '#app',\n        template: `<div>\n          <wayo-button>Button</wayo-button>\n        </div>`\n      });\n    <\/script>\n  </body>\n</html>\n```"},Pq1x:function(n,e,o){"use strict";var a=o("nOak"),t=o.n(a),l=o("wZee"),s=o.n(l),i={props:{content:{type:String,default:""}},mounted:function(){this.$nextTick(function(){s.a.highlightAll()})},updated:function(){this.$nextTick(function(){s.a.highlightAll()})},components:{VueMarkdown:t.a}},c=o("KHd+"),y=Object(c.a)(i,function(){var n=this.$createElement;return(this._self._c||n)("vue-markdown",{staticClass:"markdown-content",attrs:{source:this.content}})},[],!1,null,null,null);e.a=y.exports},QkaN:function(n,e){n.exports='## Rate 评分\n\n### 基础用法\n```html\n<wayo-rate :score="4"/>\n```\n\n### 半星\n对于不是整数的分值将显示半颗星。\n```html\n<wayo-rate :score="4.5"/>\n```\n\n### 显示分值\n```html\n<wayo-rate :score=\'3.2\' :show-score="true"/>\n```\n\n### 分值label\n```html\n<wayo-rate :score=\'4.5\' score-label="分" :show-score="true"/>\n```\n\n### 自定义颜色\n可自定义前景色（点亮的星星）和背景色（未点亮的星星）。\n```html\n<wayo-rate :score=\'4\' :show-score="true" chosen-color="#ff0000" unchosen-color="#000000"/>\n```\n\n### 自定义尺寸\n```html\n<wayo-rate :score=\'4\' :show-score="true" :size="20" :label-size="30"/>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|max|最大值，即星星个数|number|-|5|\n|score|分值|number|-|0|\n|score-label|分值文案标签|string|-|-|\n|size|星星的尺寸|number|-|14|\n|label-size|分值文案尺寸，若未指定则与size值相等|number|-|-|\n|show-score|是否显示分值|boolean|-|false|\n|chosen-color|点亮星星的颜色|string|-|#ed5026|\n|unchosen-color|未点亮星星的颜色|string|-|#d6d6d6|\n\n</div>'},RXCI:function(n,e){n.exports='## Image 图片\n\n### 基础用法\n```html\n<wayo-image src="test.png"/>\n```\n\n### 占位图\n即图片加载完成之前显示的图片，Wayo内置的占位图是搜狗地图的logo。\n\n```html\n<wayo-image src="test.png" placeholder="placeholder.png"/>\n```\n\n### 标签\n图标的标签位于图片容器的底部。超出容器宽度的标签文案被隐藏，并且以`...`结尾。\n\n```html\n<wayo-image src="test.png" label="标签"/>\n```\n\n### 说明\n说明是覆盖在图片底部黑色容器。\n\n```html\n<wayo-image src="test.png" info="说明"/>\n```\n\n### 自定义宽高\n```html\n<wayo-image src="test.png" :width="85" :height="75"/>\n```\n\n### 自定义等宽\n如果只设置了`width`属性未设置`height`属性，则图片容器最终表现为一个边长为`width`的正方形。\n\n```html\n<wayo-image src="test.png" :width="85"/>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|src|图片url|string|是|-|-|\n|width|宽度，单位`px`|number|否|-|70|\n|height|高度，单位`px`|number|否|-|70|\n|placeholder|占位图片url|string|否|-|-|\n|label|标签文案|string|否|-|-|\n|info|说明文案|string|否|-|-|\n|border|显示边框|boolean|否|-|true|\n\n</div>'},TAvu:function(n,e){n.exports='## Button 按钮\n\n### 类型\nButton类型分为无语义类型（默认）和语义类型（即有状态的类型）。\n\n```html\n\x3c!-- default --\x3e\n<wayo-button>默认按钮</wayo-button>\n\x3c!-- primary --\x3e\n<wayo-button type="primary">主要按钮</wayo-button>\n\x3c!-- info --\x3e\n<wayo-button type="info">信息按钮</wayo-button>\n\x3c!-- success --\x3e\n<wayo-button type="success">成功按钮</wayo-button>\n\x3c!-- warning --\x3e\n<wayo-button type="warning">警告按钮</wayo-button>\n\x3c!-- danger --\x3e\n<wayo-button type="danger">危险按钮</wayo-button>\n```\n\n### 尺寸\n内置的尺寸除`fit`以外均为行内块元素（即`display:inline-block;`），`fit`按钮占满容器宽度。\n\n```html\n\x3c!-- default --\x3e\n<wayo-button>默认按钮</wayo-button>\n\x3c!-- medium --\x3e\n<wayo-button size="medium">Medium按钮</wayo-button>\n\x3c!-- large --\x3e\n<wayo-button size="large">Large按钮</wayo-button>\n\x3c!-- small --\x3e\n<wayo-button size="small">Small按钮</wayo-button>\n\x3c!-- mini --\x3e\n<wayo-button size="mini">Mini按钮</wayo-button>\n\x3c!-- fit --\x3e\n<wayo-button size="fit">Fit按钮</wayo-button>\n```\n\n### 使用图标\n\n```html\n<wayo-button type="primary" icon="bus">路线</wayo-button>\n<wayo-button type="info" icon="map">地址</wayo-button>\n```\n\n### 描边按钮\n\n```html\n<wayo-button type="primary" outline>主要按钮</wayo-button>\n<wayo-button type="info" outline>信息按钮</wayo-button>\n<wayo-button type="success" outline>成功按钮</wayo-button>\n<wayo-button type="warning" outline>警告按钮</wayo-button>\n<wayo-button type="danger" outline>危险按钮</wayo-button>\n```\n\n> `default`类型的按钮描边模式无效\n\n### 圆角按钮\n\n```html\n<wayo-button round>默认按钮</wayo-button>\n<wayo-button type="primary" round>主要按钮</wayo-button>\n<wayo-button type="info" round>信息按钮</wayo-button>\n<wayo-button type="success" round>成功按钮</wayo-button>\n<wayo-button type="warning" round>警告按钮</wayo-button>\n<wayo-button type="danger" round>危险按钮</wayo-button>\n```\n\n### 圆形按钮\n圆形按钮只能含图标不能含文案，否则无效。\n\n```html\n<wayo-button type="primary" circle icon="bus"></wayo-button>\n<wayo-button type="info" circle icon="search"></wayo-button>\n<wayo-button type="success" circle icon="camera"></wayo-button>\n<wayo-button type="warning" circle icon="map"></wayo-button>\n<wayo-button type="danger" circle icon="close"></wayo-button>\n```\n\n### 禁用状态\n#### 默认类型（无语义）\n\n```html\n<wayo-button disabled>默认按钮</wayo-button>\n<wayo-button outline disabled>默认+描边</wayo-button>\n```\n\n#### 语义类型\n\n```html\n<wayo-button type="primary" disabled>主要按钮</wayo-button>\n<wayo-button type="info" disabled>信息按钮</wayo-button>\n<wayo-button type="success" disabled>成功按钮</wayo-button>\n<wayo-button type="warning" disabled>警告按钮</wayo-button>\n<wayo-button type="danger" disabled>危险按钮</wayo-button>\n```\n\n### 加载状态\n\n```html\n<wayo-button size="default" loading>加载中</wayo-button>\n<wayo-button size="default" type="primary" loading>加载中</wayo-button>\n<wayo-button size="default" type="primary" loading outline>加载中</wayo-button>\n<wayo-button size="default" type="info" loading>加载中</wayo-button>\n<wayo-button size="default" type="info" loading outline>加载中</wayo-button>\n<wayo-button size="default" type="success" loading>加载中</wayo-button>\n<wayo-button size="default" type="success" loading outline>加载中</wayo-button>\n<wayo-button size="default" type="warning" loading>加载中</wayo-button>\n<wayo-button size="default" type="warning" loading outline>加载中</wayo-button>\n<wayo-button size="default" type="danger" loading>加载中</wayo-button>\n<wayo-button size="default" type="danger" loading outline>加载中</wayo-button>\n```\n\n### 自定义颜色和尺寸\n可自定义按钮的背景色、描边颜色、字体颜色、尺寸以及字号大小。\n\n```html\n<wayo-button \n  size="default" \n  bg-color="#ffffff" \n  font-color="#ed5026" \n  border-color="#cccccc" \n  :width="70" \n  :height="40" \n  :font-size="14">默认</wayo-button>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|type|类型|string|default/primary/info/warning/danger|default|\n|size|内置尺寸|string|mini/small/medium/default/large/fit|default|\n|disabled|禁用状态|boolean|-|false|\n|loading|加载状态|boolean|-|false|\n|outline|描边按钮|boolean|-|false|\n|round|圆边按钮|boolean|-|false|\n|circle|圆形按钮|boolean|-|false|\n|icon|图标名称|string|Wayo内置icon|-|\n|bg-color|背景颜色|string|-|-|\n|font-color|字体颜色|string|-|-|\n|border-color|描边颜色|string|-|-|\n|width|宽度|string|-|-|\n|height|高度|string|-|-|\n|font-size|字号|string|-|-|\n\n</div>'},WxFc:function(n,e){n.exports='## Separator 1像素分割线\nseparator是一条在任何设备上视觉效果均为1px的直线，可选水平和垂直方向，默认为水平。\n\n### 使用方法\n```html\n<wayo-separator></wayo-separator>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|direction|方向|string|row/column|row|\n|height|高度，仅在direction=column时有效|number|-|-|\n|color|颜色|string|-|#cccccc|\n|absolute|绝对定位|boolean|-|false|\n\n</div>'},XIJ9:function(n,e){n.exports="## Toast 轻提示\n\n### 基础用法\n```javascript\nthis.$toast({\n  type: 'text',\n  mask: false,\n  message: '操作成功',\n  duration: 3000\n});\n```\n\n#### 选项\n<div class=\"table-box\">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|type|类型|string|否|text/success/fail/loading|text|\n|message|文案|string/Array|否|-|-|\n|duration|触发自动消失的时间间隔|number|否|-|3000|\n|mask|显示全屏遮层|boolean|否|-|false|\n\n</div>\n\n### 快捷API\n除了以上调用方式，Wayo同时提供以下几个快捷API。\n#### 成功提示\n```javascript\nthis.$toast.success('操作成功');\n```\n\n#### 失败提示\n```javascript\nthis.$toast.fail('操作失败');\n```\n\n#### 加载提示\n```javascript\nthis.$toast.loading('加载中');\n```\n\n### 多行文案\n将`message`设置为数组将会将数组中每个元素为显示为一行。\n```javascript\nthis.$toast.success([\n  '操作成功',\n  '请按提示继续操作'\n]);\n```"},ZX3u:function(n,e){n.exports='## Tag 标签\n\n### 类型\nTag类型分为无语义类型（默认）和语义类型（即有状态的类型）。\n\n```html\n\x3c!-- default --\x3e\n<wayo-tag>default</wayo-tag>\n\x3c!-- primary --\x3e\n<wayo-tag type="primary">primary</wayo-tag>\n\x3c!-- info --\x3e\n<wayo-tag type="info">info</wayo-tag>\n\x3c!-- success --\x3e\n<wayo-tag type="success">success</wayo-tag>\n\x3c!-- warning --\x3e\n<wayo-tag type="warning">warning</wayo-tag>\n\x3c!-- danger --\x3e\n<wayo-tag type="danger">danger</wayo-tag>\n```\n\n### 尺寸\n\n```html\n\x3c!-- default --\x3e\n<wayo-tag>default</wayo-tag>\n\x3c!-- large --\x3e\n<wayo-tag size="large">large</wayo-tag>\n\x3c!-- small --\x3e\n<wayo-tag size="small">small</wayo-tag>\n\x3c!-- mini --\x3e\n<wayo-tag size="mini">mini</wayo-tag>\n```\n\n### 圆角\n\n```html\n<wayo-tag type="primary" round>primary</wayo-tag>\n```\n\n### 描边\n与Button的描边模式一致。\n\n```html\n<wayo-tag outline>default</wayo-tag>\n<wayo-tag type="primary" outline>primary</wayo-tag>\n<wayo-tag type="info" outline>info</wayo-tag>\n<wayo-tag type="success" outline>success</wayo-tag>\n<wayo-tag type="warning" outline>warning</wayo-tag>\n<wayo-tag type="danger" outline>danger</wayo-tag>\n```\n\n### 自定义颜色&尺寸\n```html\n\x3c!-- 背景色&字体颜色 --\x3e\n<wayo-tag bg-color="#000000" text-color="#d82c2c">tag</wayo-tag>\n\x3c!-- 高度和宽度 --\x3e\n<wayo-tag :width="70" :height="30">tag</wayo-tag>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|type|类型|string|default/primary/info/warning/danger|default|\n|size|内置尺寸|string|mini/small/default/|default|\n|outline|描边按钮|boolean|-|false|\n|round|圆边按钮|boolean|-|false|\n|bg-color|背景颜色|string|-|-|\n|text-color|字体颜色|string|-|-|\n|width|宽度|string|-|-|\n|height|高度|string|-|-|\n\n</div>'},a1Ez:function(n,e){n.exports='## 色彩\nWayo内置的主题色彩以搜狗地图的配色为基础。\n\n### 主色\nWayo的品牌颜色为橙色\n<div class="color-item" style="background-color:#ED5026;">\n  <div class="color-item__content">\n    <label>Primary</label>\n    <br>\n    <span>#ED5026</span>\n  </div>\n</div>\n\n### 辅助色\n辅助色是一些具有状态语义的色彩\n<div class="color-item" style="background-color:#45CD09;">\n  <div class="color-item__content">\n    <label>Success</label>\n    <br>\n    <span>#45CD09</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#067FFA;">\n  <div class="color-item__content">\n    <label>Info</label>\n    <br>\n    <span>#067FFA</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#F39800;">\n  <div class="color-item__content">\n    <label>Warning</label>\n    <br>\n    <span>#F39800</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#F43838;">\n  <div class="color-item__content">\n    <label>Danger</label>\n    <br>\n    <span>#F43838</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#CCCCCC;">\n  <div class="color-item__content">\n    <label>Disabled</label>\n    <br>\n    <span>#CCCCCC</span>\n  </div>\n</div>\n\n### 文字\n<div class="color-item" style="background-color:#333333;">\n  <div class="color-item__content">\n    <label>主要文字</label>\n    <br>\n    <span>#333333</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#5F5F5F;">\n  <div class="color-item__content">\n    <label>常规文字</label>\n    <br>\n    <span>#5F5F5F</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#999999;">\n  <div class="color-item__content">\n    <label>次要文字</label>\n    <br>\n    <span>#999999</span>\n  </div>\n</div>\n<div class="color-item" style="background-color:#CCCCCC;">\n  <div class="color-item__content">\n    <label>占位文字</label>\n    <br>\n    <span>#CCCCCC</span>\n  </div>\n</div>\n\n### 边框\n<div class="color-item" style="background-color:#CCCCCC;">\n  <div class="color-item__content">\n    <label>边框</label>\n    <br>\n    <span>#CCCCCC</span>\n  </div>\n</div>'},dJ5y:function(n,e,o){"use strict";e.a={props:{name:{type:String,default:""}},computed:{content:function(){return this.name?o("1qy0")("./"+this.$route.name+"/"+this.name+".md"):""}}}},dZkr:function(n,e){n.exports='## 字体\n\n### font-family\nWayo并未内置字体，继承页面设置。\n\n### 字号\n<table class="font-table">\n  <tr class="font-table__tr" style="font-size:15px;">\n    <td class="font-table__td">大号</td>\n    <td class="font-table__td">large</td>\n    <td class="font-table__td">15px</td>\n  </tr>\n  <tr class="font-table__tr" style="font-size:14px;">\n    <td>中等</td>\n    <td>medium</td>\n    <td>14px</td>\n  </tr>\n  <tr class="font-table__tr" style="font-size:13px;">\n    <td>默认</td>\n    <td>default</td>\n    <td>13px</td>\n  </tr>\n  <tr class="font-table__tr" style="font-size:12px;">\n    <td>小号</td>\n    <td>small</td>\n    <td>12px</td>\n  </tr>\n  <tr class="font-table__tr" style="font-size:10px;">\n    <td>超小号</td>\n    <td>mini</td>\n    <td>10px</td>\n  </tr>\n</table>'},e0Wz:function(n,e){n.exports='## Showcase 展柜\n\n### 基础用法\n```html\n<template>\n  <wayo-showcase>\n    <wayo-showcase-item v-for="(item,index) in list" \n      :key="`showcase-item-${index}`"\n      :thumb="item.thumb">\n       {{item.info}}\n    </wayo-showcase-item>\n  </wayo-showcase>\n</template>\n<script>\n  export default {\n    data(){\n      return {\n        list: [{\n          thumb: \'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2516062089.jpg\',\n          info: \'第一个\'\n        },{\n          thumb: \'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2519070834.jpg\',\n          info: \'第二个\'\n        },{\n          thumb: \'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2522880251.jpg\',\n          info: \'第三个\'\n        },{\n          thumb: \'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2525528688.jpg\',\n          info: \'第四个\'\n        },{\n          thumb: \'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2526297221.jpg\',\n          info: \'第五个\'\n        },{\n          thumb: \'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2526767688.jpg\',\n          info: \'第六个\'\n        }]\n      };\n    }\n  };\n<\/script>\n```\n\n### 自定义操作区背景\n可以将背景修改颜色或者使用背景图片；\n\n```html\n<wayo-showcase nav-bg="#ff0000">\n  <wayo-showcase-item v-for="(item,index) in list" \n    :key="`showcase-item-${index}`"\n    :thumb="item.thumb">\n     {{item.info}}\n  </wayo-showcase-item>\n</wayo-showcase>\n<wayo-showcase :nav-bg="bgImg">\n  <wayo-showcase-item v-for="(item,index) in list" \n    :key="`showcase-item-${index}`"\n    :thumb="item.thumb">\n     {{item.info}}\n  </wayo-showcase-item>\n</wayo-showcase>\n```\n\n### Showcase 属性\n<div class="table-box">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|nav-bg|展览区背景|string|否|-|-|\n\n</div>\n\n### Showcase-item 属性\n<div class="table-box">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|thumb|展览区图片url|string|是|-|-|\n\n</div>'},frNE:function(n,e){n.exports='## Icon 图标\n\n### 使用方法\n```html\n<wayo-icon name="bus" color="#000000" :size="24"/>\n```\n\n### 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|name|名称|string|见demo|-|\n|color|颜色|string|继承父元素|-|\n|size|尺寸|number|继承父元素|-|\n\n</div>'},ulLb:function(n,e){n.exports='## Tabs 标签页\n\n### 基础用法\n\n```html\n<wayo-tabs>\n  <wayo-tab label="标签1" name="default_1">内容1</wayo-tab>\n  <wayo-tab label="标签2" name="default_2">内容2</wayo-tab>\n</wayo-tabs>\n```\n\n### 使用图标\n```html\n<wayo-tabs>\n  <wayo-tab label="标签1" icon="bus" name="default_1">内容1</wayo-tab>\n  <wayo-tab label="标签2" icon="station" name="default_2">内容2</wayo-tab>\n</wayo-tabs>\n```\n\n### stripe风格\n```html\n<wayo-tabs stripe align="center">\n  <wayo-tab label="标签1" name="default_1">内容1</wayo-tab>\n  <wayo-tab label="标签2" name="default_2">内容2</wayo-tab>\n  <wayo-tab label="标签3" name="default_3">内容3</wayo-tab>\n  <wayo-tab label="标签4" name="default_4">内容4</wayo-tab>\n</wayo-tabs>\n```\n\n### 超出边界\n超出容器宽度的标签在切换至其前一个标签的同时会自动将超出部分的下一个相邻标签偏移至视野之内。\n\n```html\n<wayo-tabs>\n  <wayo-tab label="标签1" name="default_1">内容1</wayo-tab>\n  <wayo-tab label="标签2" name="default_2">内容2</wayo-tab>\n  <wayo-tab label="标签3" name="default_3">内容3</wayo-tab>\n  <wayo-tab label="标签4" name="default_4">内容4</wayo-tab>\n  <wayo-tab label="标签5" name="default_5">内容5</wayo-tab>\n  <wayo-tab label="标签6" name="default_6">内容6</wayo-tab>\n  <wayo-tab label="标签7" name="default_7">内容7</wayo-tab>\n  <wayo-tab label="标签8" name="default_8">内容8</wayo-tab>\n</wayo-tabs>\n```\n\n### Tabs 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|stripe|stripe风格|boolean|-|false|\n|border-top|上边框|boolean|-|false|\n|border-bottom|下边框|boolean|-|false|\n|align|操作区的对齐规则|string|left/center/right|left|\n|flex|操作区的每个标签的宽度绝对相等|boolean|-|false|\n\n</div>\n\n### Tab 属性\n<div class="table-box">\n\n|参数|说明|类型|必填|可选值|默认值|\n|:--|:--|:--|:--|:--|:--|\n|name|唯一名称|string|是|-|-|\n|label|操作区文案|string|是|-|-|\n|icon|图标|string|否|Wayo内置图标|-|\n\n</div>'},vuDV:function(n,e){n.exports='## 安装\n\n### npm安装(推荐)\n项目根目录下执行：\n\n``` bash\nnpm install wayo --save-dev\n```\n\n### CDN\n```html\n<html>\n  <head>\n    \x3c!-- 引入样式 --\x3e\n    <link rel="stylesheet" href="https://unpkg.com/wayo/dist/wayo.min.css">\n  </head>\n  <body>\n    \x3c!-- 引入组件库之前必须先引入vue --\x3e\n    <script src="https://unpkg.com/vue/dist/vue.js"><\/script>\n    \x3c!-- 引入组件库 --\x3e\n    <script src="https://unpkg.com/wayo/dist/wayo.min.js"><\/script>\n  </body>\n</html>\n```\n\n'},yLpj:function(n,e,o){n.exports=o("75qh")(0)},zNef:function(n,e){n.exports='## Lath 横幅\n\nWayo对Lath组件的定义为：\n> 满宽的、具有一定语义的一个区域。与Block组件不同的是：Lath组件可以作为Block组件的一个条目，从语义的角度可以将其理解为Block语义的一个子集。\n\n### 基础用法\n```html\n<wayo-block>\n  <wayo-lath  border-bottom icon-position="top">\n    <wayo-lath-header title="标题" subtitle="副标题"></wayo-lath-header>\n    <wayo-lath-content content="内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容"></wayo-lath-content>\n    <wayo-lath-tail icon="arrow-right" label="打开"></wayo-lath-tail>\n  </wayo-lath>\n</wayo-block>\n```\n\n### 标题\n可定义主标题和副标题\n\n```html\n<wayo-lath>\n  <wayo-lath-header title="标题" subtitle="副标题" ></wayo-lath-header>\n</wayo-lath>\n```\n\n### 内容\n默认内容不超过3行，超出的部分隐藏并且显示“更多”标记。可以通过修改Lath-content组件的`content-line-limit`设置内容的最大行数限制。\n\n> 行数限制功能只有将内容文案以`props`传入（即`:content="content"`）才可生效。通过slot定义的内容无此功能。\n\n```html\n<wayo-lath>\n  <wayo-lath-content content="内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容"></wayo-lath-content>\n</wayo-lath>\n```\n\n### 图标\n可以修改Lath组件的`icon`指定Wayo内置的图标，并且可以自定义颜色和位置。图标的位置默认是相对于Lath组件的垂直居中，修改`icon-position`为`top`则将使图标始终与主标题对齐。\n\n```html\n<wayo-lath icon="bus" icon-color="#ff0000" icon-position="top">\n  <wayo-lath-header title="标题" subtitle="副标题" ></wayo-lath-header>\n</wayo-lath>\n```\n\n### 尾部\nLath-tail位于Lath组件的最右侧且垂直居中，可定义图标、图标颜色和标签文案。\n\n```html\n<wayo-lath>\n  <wayo-lath-tail icon="arrow-right" label="打开"></wayo-lath-tail>\n</wayo-lath>\n```\n\n### 平铺布局\n默认情况下，Lath组件是垂直布局，即Lath-header和Lath-content为块级元素，各占一行。将Lath组件的属性`inline`设置为`true`则将其布局模式改为平铺，即Lath-header、Lath-content以及Lath-tail水平排列。\n\n```html\n<wayo-lath icon="location" icon-position="top" inline>\n  <wayo-lath-header title="标题" subtitle="副标题"></wayo-lath-header>\n  <wayo-lath-content content="内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容内容"></wayo-lath-content>\n  <wayo-lath-tail icon="arrow-right" label="打开"></wayo-lath-tail>\n</wayo-lath>\n```\n\n### Lath 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|icon|图标名称|string|Wayo内置图标|-|\n|icon-color|图标颜色|string|-|-|\n|icon-position|图标定位|string|middle/top|middle|\n|border-bottom|下边框|boolean|-|false|\n|border-top|上边框|boolean|-|false|\n|inline|平铺布局|boolean|-|false|\n\n</div>\n\n### Lath-header 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|title|主标题|string|-|-|\n|subtitle|副标题|string|-|-|\n\n\n</div>\n\n### Lath-content 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|content|内容文案|string|-|-|\n|content-line-limit|行数显示|-|3|\n|content-expand-label|超出行数显示时显示更多按钮的文案|string|-|更多|\n\n\n</div>\n\n### Lath-tail 属性\n<div class="table-box">\n\n|参数|说明|类型|可选值|默认值|\n|:--|:--|:--|:--|:--|\n|icon|图标名称|string|Wayo内置图标|-|\n|icon-color|图标颜色|string|-|-|\n|label|标签文案|string|-|-|\n\n</div>'}}]);